// import logo from './logo.svg';
import './App.css';
import DNA from 'react-loader-spinner/dist/loader/Dna';

function App() {
  return (
    <div className="App">
      <DNA
        type="ThreeDots"
        color="#00BFFF"
        height={100}
        width={100}
        timeout={3000} //3 secs
      />
    </div>
  );
}

export default App;
